def Skew(genome):

	skewVal = [0]*(len(genome)+1)
	minVal = 0
	minIndex = []

	for i in range(len(genome)):
		if genome[i] == "C":
			skewVal[i+1] = skewVal[i] - 1
			if skewVal[i+1] < minVal:
				minVal = skewVal[i+1]
		elif genome[i] == "G":
			skewVal[i+1] = skewVal[i] + 1
			if skewVal[i+1] < minVal:
                                minVal = skewVal[i+1]
		else:
			skewVal[i+1] = skewVal[i]
			if skewVal[i+1] < minVal:
                                minVal = skewVal[i+1]

	for j in range(len(skewVal)):
		if skewVal[j] == minVal:
			minIndex.append(j)
	
	return ' '.join([str(i) for i in minIndex])

print(Skew("CCTATCGGTGGATTAGCATGTCCCTGTACGTTTCGCCGCGAACTAGTTCACACGGCTTGATGGCAAATGGTTTTTCCGGCGACCGTAATCGTCCACCGAG"))

print(Skew(""))

